import React from "react";
import {Button} from 'react-native-elements';

const StyledButton = (props) => {
  const {text, style, onClick} = props;
  return (
    <Button title={text}
            type="outline"
            raised
            style={style}
            onClick={onClick}/>
  )
};

export default StyledButton;
